import React from 'react';
import styled from 'styled-components';
import './Logo.js';

const SearchbarS = styled.div`
  position: relative;
  width: 300px;
  height: 36px;
  text-align: center;
  margin-left:20px;
  margin-right:8px;
  display: flex;
`;

const InputbarS = styled.input`
  align-items:center;
  width : 200px;
  height: 24px;
  background-color: rgb(236, 236, 236);
  border: 1px solid red;
  margin-bottom: 5px;
  display: flex;
`;

const Icon_FilterS = styled.img`
  position : absolute;
  width: 17px;
  top: 10px;
  right: 12px;
  margin: 0;
  display: flex;
`;

const Icon_SearchS = styled.img`
  position : absolute;
  width: 17px;
  top: 10px;
  right: 12px;
  margin: 0;
  display: flex;
`;

function Searchbar({ children }) {

  return <SearchbarS>
    <Icon_FilterS src="https://cdn-icons-png.flaticon.com/512/4502/4502383.png"/>
    <InputbarS type="text" placeholder="검색어 입력"/>
    <Icon_SearchS src="https://s3.ap-northeast-2.amazonaws.com/cdn.wecode.co.kr/icon/search.png"/>
  </SearchbarS>;
}

export default Searchbar;
